import styled from '@emotion/styled'
import { useNavigate } from 'react-router-dom'

const MainPage = () => {
  const navigate = useNavigate()
  return (
    <PageWrapper>
      <h1>MainPage</h1>
      <ButtonListWrapper>
        <PageRouterButton onClick={() => navigate('/teahouse')}>Teahouse</PageRouterButton>
        <PageRouterButton onClick={() => navigate('/tea-together')}>Tea Together</PageRouterButton>
        <PageRouterButton onClick={() => navigate('/post')}>Post</PageRouterButton>
      </ButtonListWrapper>
    </PageWrapper>
  )
}
export default MainPage

const PageWrapper = styled.div`
  padding: 60px 20px 20px 20px;
  display: flex;
  flex-direction: column;
  gap: 10px;
`
const ButtonListWrapper = styled.div`
display: flex;
flex-direction: row;
flex-wrap: wrap;
gap: 20px;
`
const PageRouterButton = styled.button`
  padding: 10px 20px;
  font-size: 16px;
  background-color: #01c897;
  border-radius: 10px;
  color: #fff;
  font-weight: 800;
`
